  render() {
    return (
      <div className="Side-bar" id="Hearts-bar">
        <img src={heartOff} className="Side-icon" id="Heart-icon" alt="heart icon" />  
        <img src={heartOff} className="Side-icon" id="Heart-icon" alt="heart icon" />  
        <img src={heartOff} className="Side-icon" id="Heart-icon" alt="heart icon" />  
      </div>
    );
  }
}

